YY_PARSE(void) yylinecol(const unsigned char *input, int offset, int *line_out, int *col_out)
{
  int i, line = 1;

  for (i = 0; i <= offset; ++i) {
    if(input[i] == '\n') {
      ++line;
    }
  }
  while (i > 0) {
    if(input[--i] == '\n') {
      ++i;
      break;
    }
  }
  *line_out = line;
  *col_out = 1 + offset - i;
}

